<div class="container-fluid main-container">


<div id="header">
<h1 class="title">odeintr</h1>
<h4 class="author"><em>Timothy H. Keitt</em></h4>
<h4 class="date"><em>04/17/2015</em></h4>
</div>


<p>The odeintr is package for integrating differential equations in R. The integration engine is the <a href="http://www.odeint.com">Boost odeint package</a>.</p>
<div id="features" class="section level3">
<h3>Features</h3>
<ol style="list-style-type: decimal">
<li>Simple specification of the ODE system</li>
<li>Intelligent defaults, easily overridden, used throughout</li>
<li>A wide range of integration methods available for compiled system (see <a href="http://www.boost.org/doc/libs/1_58_0/libs/numeric/odeint/doc/html/boost_numeric_odeint/odeint_in_detail/steppers.html#boost_numeric_odeint.odeint_in_detail.steppers.stepper_overview">stepper types</a>)</li>
<li>Fully automated compilation of ODE system specified in C++</li>
<li>Results returned as a simple data frame ready for analysis and plotting</li>
<li>Ability to specify a custom observer in R that can return arbitrary data</li>
<li>Three options for calling the observer: at regular intervals, after each update step or at specified times</li>
<li>Ability to alter system state and restart simulations where you left off</li>
<li>Can compile an implicit solver with symbolic evaluation of the Jacobian</li>
<li>You can easily save and edit the generated C++ code</li>
</ol>
</div>
<div id="installation" class="section level3">
<h3>Installation</h3>
<pre><code>devtools::install_github(&quot;thk686/odeintr&quot;)</code></pre>
</div>
<div id="examples" class="section level3">
<h3>Examples</h3>
<pre class="r"><code>library(odeintr)
dxdt = function(x, t) x * (1 - x)
system.time({x = integrate_sys(dxdt, 0.001, 15, 0.01)})</code></pre>
<pre><code>##    user  system elapsed 
##   0.090   0.004   0.100</code></pre>
<pre class="r"><code>plot(x, type = &quot;l&quot;, lwd = 3, col = &quot;steelblue&quot;, main = &quot;Logistic Growth&quot;)</code></pre>
<p><img src="data:image/png;base64," /></p>
<pre class="r"><code>compile_sys(&quot;logistic&quot;, &quot;dxdt = x * (1 - x)&quot;)
system.time({x = logistic(0.001, 15, 0.01)})</code></pre>
<pre><code>##    user  system elapsed 
##   0.001   0.000   0.001</code></pre>
<pre class="r"><code>plot(x, type = &quot;l&quot;, lwd = &quot;3&quot;, col = &quot;steelblue&quot;, main = &quot;Logistic Growth&quot;)
points(logistic_at(0.001, sort(runif(10, 0, 15)), 0.01), col = &quot;darkred&quot;)</code></pre>
<p><img src="data:image/png;base64," /></p>
<pre class="r"><code>dxdt = function(x, t) c(x[1] - x[1] * x[2], x[1] * x[2] - x[2])
obs = function(x, t) c(Prey = x[1], Predator = x[2], Ratio = x[1] / x[2])
system.time({x = integrate_sys(dxdt, rep(2, 2), 20, 0.01, observer = obs)})</code></pre>
<pre><code>##    user  system elapsed 
##   0.218   0.021   0.269</code></pre>
<pre class="r"><code>plot(x[, c(2, 3)], type = &quot;l&quot;, lwd = 2, col = &quot;steelblue&quot;, main = &quot;Lotka-Volterra Phase Plot&quot;)</code></pre>
<p><img src="data:image/png;base64," /></p>
<pre class="r"><code>plot(x[, c(1, 4)], type = &quot;l&quot;, lwd = 2, col = &quot;steelblue&quot;, main = &quot;Prey-Predator Ratio&quot;)</code></pre>
<p><img src="data:image/png;base64," /></p>
<pre class="r"><code># C++ code
Lorenz.sys = '
  dxdt[0] = 10.0 * (x[1] - x[0]);
  dxdt[1] = 28.0 * x[0] - x[1] - x[0] * x[2];
  dxdt[2] = -8.0 / 3.0 * x[2] + x[0] * x[1];
  ' # Lorenz.sys
compile_sys(&quot;lorenz&quot;, Lorenz.sys)
system.time({x = lorenz(rep(1, 3), 100, 0.001)})</code></pre>
<pre><code>##    user  system elapsed 
##   0.016   0.000   0.016</code></pre>
<pre class="r"><code>plot(x[, c(2, 4)], type = 'l', col = &quot;steelblue&quot;, main = &quot;Lorenz Attractor&quot;)</code></pre>
<p><img src="data:image/png;base64," /></p>
<pre class="r"><code>VdP.sys = '
dxdt[0] = x[1];
dxdt[1] = 2.0 * (1 - x[0] * x[0]) * x[1] - x[0];
' # Vdp.sys
compile_sys(&quot;vanderpol&quot;, VdP.sys, method = &quot;bsd&quot;) # Bulirsch-Stoer
system.time({x = vanderpol(rep(1e-4, 2), 100, 0.01)})</code></pre>
<pre><code>##    user  system elapsed 
##   0.002   0.000   0.002</code></pre>
<pre class="r"><code>par(mfrow = c(2, 2), mar = rep(0.5, 4), oma = rep(5, 4), xpd = NA)
make.plot = function(xy, xlab = NA, ylab = NA)
  plot(xy, col = &quot;steelblue&quot;, lwd = 2, type = &quot;l&quot;,
       axes = FALSE, xlab = xlab, ylab = ylab)
plot.new()
make.plot(x[, c(3, 1)]); axis(3); axis(4)
make.plot(x[, c(1, 2)], &quot;Time&quot;, &quot;X1&quot;); axis(1); axis(2)
make.plot(x[, c(3, 2)], &quot;X2&quot;); axis(1); axis(4)
title(main = &quot;Van der Pol Oscillator&quot;, outer = TRUE)</code></pre>
<p><img src="data:image/png;base64," /></p>
<pre class="r"><code># Use a dynamic parameter
VdP.sys = '
dxdt[0] = x[1];
dxdt[1] = mu * (1 - x[0] * x[0]) * x[1] - x[0];
' # Vdp.sys
compile_sys(&quot;vpol2&quot;, VdP.sys, &quot;mu&quot;, method = &quot;bsd&quot;)
par(mfrow = c(2, 2), mar = rep(1, 4), oma = rep(3, 4), xpd = NA)
for (mu in seq(0.5, 2, len = 4))
{
  vpol2_set_params(mu = mu)
  x = vpol2(rep(1e-4, 2), 100, 0.01)
  make.plot(x[, 2:3]); box()
  title(paste(&quot;mu =&quot;, round(mu, 2)))
}
title(&quot;Van der Pol Oscillator Parameter Sweep&quot;, outer = TRUE)
title(xlab = &quot;X1&quot;, ylab = &quot;X2&quot;, line = 0, outer = TRUE)</code></pre>
<p><img src="data:image/png;base64," /></p>
<pre class="r"><code># Stiff example from odeint docs
Stiff.sys = '
  dxdt[0] = -101.0 * x[0] - 100.0 * x[1];
  dxdt[1] = x[0];
' # Stiff.sys
cat(JacobianCpp(Stiff.sys))</code></pre>
<pre><code>## J(0, 0) = -101;
## J(0, 1) = -100;
## J(1, 0) = 1;
## J(1, 1) = 0;
## dfdt[0] = 0.0;
## dfdt[1] = 0.0;</code></pre>
<pre class="r"><code>compile_implicit(&quot;stiff&quot;, Stiff.sys)
x = stiff(c(2, 1), 5, 0.001)
plot(x[, 1:2], type = &quot;l&quot;, lwd = 2, col = &quot;steelblue&quot;)
lines(x[, c(1, 3)], lwd = 2, col = &quot;darkred&quot;)</code></pre>
<p><img src="data:image/png;base64," /></p>
<pre class="r"><code># Robertson chemical kinetics problem
Robertson = '
dxdt[0] = -alpha * x[0] + beta * x[1] * x[2];
dxdt[1] = alpha * x[0] - beta * x[1] * x[2] - gamma * x[1] * x[1];
dxdt[2] = gamma * x[1] * x[1];
' # Robertson
pars = c(alpha = 0.04, beta = 1e4, gamma = 3e7)
init.cond = c(1, 0, 0)
cat(JacobianCpp(Robertson))</code></pre>
<pre><code>## J(0, 0) = -alpha;
## J(0, 1) = beta * x[2];
## J(0, 2) = beta * x[1];
## J(1, 0) = alpha;
## J(1, 1) = -(beta * x[2] + (gamma * x[1] + gamma * x[1]));
## J(1, 2) = -(beta * x[1]);
## J(2, 0) = 0;
## J(2, 1) = gamma * x[1] + gamma * x[1];
## J(2, 2) = 0;
## dfdt[0] = 0.0;
## dfdt[1] = 0.0;
## dfdt[2] = 0.0;</code></pre>
<pre class="r"><code>compile_implicit(&quot;robertson&quot;, Robertson, pars, TRUE)
at = 10 ^ seq(-5, 5, len = 400)
x = robertson_at(init.cond, at)
par(mfrow = c(3, 1), mar = rep(0.5, 4), oma = rep(5, 4), xpd = NA)
plot(x[, 1:2], type = &quot;l&quot;, lwd = 3,
     col = &quot;steelblue&quot;, log = &quot;x&quot;, axes = F, xlab = NA)
axis(2); box()
plot(x[, c(1, 3)], type = &quot;l&quot;, lwd = 3,
     col = &quot;steelblue&quot;, log = &quot;x&quot;, axes = F, xlab = NA)
axis(4); box()
plot(x[, c(1, 4)], type = &quot;l&quot;, lwd = 3,
     col = &quot;steelblue&quot;, log = &quot;x&quot;, axes = F)
axis(2); axis(1); box()</code></pre>
<p><img src="data:image/png;base64," /></p>
</div>
<div id="performance" class="section level3">
<h3>Performance</h3>
<p>Because ODEINT is a header-only library, the entire integration path is exposed to the compiler. That means your system functions can be inlined with the integration code, loops unrolled, etc. It will help if you enable optimization in your compiler. Use “-O3” with gcc. See the R documentation on the user Makevars file. (Odeintr now provides a convenient function to set the compiler optimization level.)</p>
<p>The Lorenz and Van der Pol examples above show about 10 million observer calls per second.</p>
